import re
from datetime import datetime

def clean_number(value):
    """Remove R, spaces, commas from numbers"""
    if not value or value.strip() == '':
        return '0.00'
    cleaned = str(value).replace('R', '').replace(' ', '').replace(',', '.').strip()
    # Handle multiple decimals or invalid formats
    try:
        float(cleaned)
        return cleaned
    except:
        return '0.00'

def parse_date(date_str):
    """Convert date string to SQL format YYYY-MM-DD"""
    try:
        # Try format YYYY/MM/DD
        dt = datetime.strptime(date_str.strip(), '%Y/%m/%d')
        return dt.strftime('%Y-%m-%d')
    except:
        try:
            # Try format YYYY-MM-DD
            dt = datetime.strptime(date_str.strip(), '%Y-%m-%d')
            return dt.strftime('%Y-%m-%d')
        except:
            return date_str.strip()

def escape_sql(text):
    """Escape single quotes for SQL"""
    return str(text).replace("'", "''")

def convert_to_sql():
    """Convert tab-delimited data to SQL INSERT statements"""
    
    lines = [line.strip() for line in SALES_DATA.strip().split('\n') if line.strip()]
    
    if len(lines) == 0:
        print("ERROR: No data found! Please paste your sales data between the triple quotes.")
        return
    
    sql_values = []
    errors = []
    
    for line_num, line in enumerate(lines, 1):
        parts = line.split('\t')
        
        if len(parts) < 11:
            errors.append(f"Line {line_num}: Expected 11 columns, got {len(parts)}")
            continue
        
        try:
            cust_code = escape_sql(parts[0].strip())
            cust_name = escape_sql(parts[1].strip())
            item_sku = escape_sql(parts[2].strip())
            item_desc = escape_sql(parts[3].strip())
            province = escape_sql(parts[4].strip())
            invoice = escape_sql(parts[5].strip())
            sale_date = parse_date(parts[6])
            location = escape_sql(parts[7].strip())
            qty = clean_number(parts[8])
            unit_price = clean_number(parts[9])
            total_amt = clean_number(parts[10])
            
            sql = f"('{cust_code}', '{cust_name}', '{item_sku}', '{item_desc}', '{province}', '{invoice}', '{sale_date}', '{location}', {qty}, {unit_price}, {total_amt})"
            sql_values.append(sql)
            
        except Exception as e:
            errors.append(f"Line {line_num}: {str(e)}")
    
    # Print results
    print("=" * 80)
    print(f"CONVERSION COMPLETE: {len(sql_values)} rows processed")
    print("=" * 80)
    print()
    
    if errors:
        print("ERRORS FOUND:")
        for error in errors[:10]:  # Show first 10 errors
            print(f"  - {error}")
        if len(errors) > 10:
            print(f"  ... and {len(errors) - 10} more errors")
        print()
    
    print("COPY THE SQL BELOW INTO import-sales-records-2025.sql")
    print("Replace lines 37-60 with this:")
    print("-" * 80)
    print()
    print("INSERT INTO #RawSalesData (CustomerCode, CustomerName, ItemSKU, ItemDescription, Province, InvoiceNumber, SaleDate, Location, QuantitySold, UnitPrice, TotalAmount)")
    print("VALUES")
    
    for i, value in enumerate(sql_values):
        if i < len(sql_values) - 1:
            print(f"    {value},")
        else:
            print(f"    {value};")
    
    print()
    print("-" * 80)
    print(f" Generated {len(sql_values)} INSERT statements")
    print()
    print("NEXT STEPS:")
    print("1. Copy the INSERT INTO statement above")
    print("2. Open: DatabaseManagement/import-sales-records-2025.sql")
    print("3. Replace lines 37-60 with the copied SQL")
    print("4. Run the script in Azure Data Studio")
    print("=" * 80)

if __name__ == "__main__":
    convert_to_sql()
